import React from "react";

const InfoPanel = () => {
  return (
    <div className="page-info-panel">
      <div className="row">
        <div className="col-10">
          <p className="title">Manual Upload</p>
          <p className="sub-title">
            Here you can upload manual files or documents and also manage them.
          </p>
        </div>
        <div className="col">
          <div className="btn-group text-right">
            <button className="btn btn-outline-primary">
              <i className="fa fa-plus-square mr-2"></i>
              Add Document
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default InfoPanel;
